/* Database export results for db library */

/* Preserve session variables */
SET @OLD_FOREIGN_KEY_CHECKS=@@FOREIGN_KEY_CHECKS;
SET FOREIGN_KEY_CHECKS=0;

/* Export data */

/* Table structure for lib_admin */
CREATE TABLE `lib_admin` (
  `adm_id` char(15) NOT NULL,
  `adm_name` varchar(45) NOT NULL,
  `adm_password` char(32) NOT NULL,
  `adm_status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`adm_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/* data for Table lib_admin */

/* Table structure for lib_book */
CREATE TABLE `lib_book` (
  `book_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `book_title` varchar(150) NOT NULL,
  `book_author` varchar(150) NOT NULL,
  `book_edition` varchar(20) NOT NULL,
  `book_publisher` varchar(80) NOT NULL,
  `place_of_publication` varchar(30) DEFAULT NULL,
  `year_of_publication` varchar(10) DEFAULT NULL,
  `total_page_number` int(10) unsigned DEFAULT NULL,
  `book_comments` varchar(255) DEFAULT NULL,
  `book_status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`book_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2886 DEFAULT CHARSET=latin1;

/* data for Table lib_book */

/* Table structure for lib_borrow */
CREATE TABLE `lib_borrow` (
  `bor_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `bor_date` date NOT NULL,
  `last_date` date NOT NULL,
  `return_date` date NOT NULL,
  `bor_status` tinyint(1) unsigned NOT NULL,
  `bor_fine` decimal(10,2) NOT NULL,
  `copy_id` int(10) unsigned NOT NULL,
  `mem_id` char(15) NOT NULL,
  PRIMARY KEY (`bor_id`),
  KEY `FK_lib_borrow_1` (`copy_id`),
  KEY `FK_lib_borrow_2` (`mem_id`),
  CONSTRAINT `FK_lib_borrow_1` FOREIGN KEY (`copy_id`) REFERENCES `lib_copy` (`copy_id`) ON UPDATE CASCADE,
  CONSTRAINT `FK_lib_borrow_2` FOREIGN KEY (`mem_id`) REFERENCES `lib_member` (`mem_id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/* data for Table lib_borrow */

/* Table structure for lib_copy */
CREATE TABLE `lib_copy` (
  `copy_id` int(10) unsigned NOT NULL,
  `copy_date` date DEFAULT NULL,
  `copy_source` varchar(80) DEFAULT NULL,
  `copy_price` decimal(10,2) unsigned NOT NULL,
  `copy_type` tinyint(1) unsigned NOT NULL,
  `copy_status` tinyint(1) unsigned NOT NULL,
  `book_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`copy_id`),
  KEY `FK_lib_copy_1` (`book_id`),
  CONSTRAINT `FK_lib_copy_1` FOREIGN KEY (`book_id`) REFERENCES `lib_book` (`book_id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/* data for Table lib_copy */

/* Table structure for lib_demand */
CREATE TABLE `lib_demand` (
  `dem_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `dem_date` date NOT NULL,
  `available_date` date NOT NULL,
  `expire_date` date NOT NULL,
  `dem_status` tinyint(1) unsigned NOT NULL,
  `book_id` int(10) unsigned NOT NULL,
  `mem_id` char(15) NOT NULL,
  PRIMARY KEY (`dem_id`),
  KEY `FK_lib_demand_1` (`book_id`),
  KEY `FK_lib_demand_2` (`mem_id`),
  CONSTRAINT `FK_lib_demand_1` FOREIGN KEY (`book_id`) REFERENCES `lib_book` (`book_id`) ON UPDATE CASCADE,
  CONSTRAINT `FK_lib_demand_2` FOREIGN KEY (`mem_id`) REFERENCES `lib_member` (`mem_id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/* data for Table lib_demand */

/* Table structure for lib_member */
CREATE TABLE `lib_member` (
  `serial_number` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mem_id` char(15) NOT NULL,
  `mem_password` char(32) NOT NULL,
  `mem_name` varchar(45) NOT NULL,
  `mem_session` varchar(15) NOT NULL,
  `mem_fine` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `mem_status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`serial_number`,`mem_id`) USING BTREE,
  UNIQUE KEY `idx_mem_id` (`mem_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/* data for Table lib_member */

/* Table structure for lib_payment */
CREATE TABLE `lib_payment` (
  `pay_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_token` varchar(20) NOT NULL,
  `pay_date` date NOT NULL,
  `mem_id` char(15) NOT NULL,
  `pay_amount` decimal(10,2) unsigned NOT NULL,
  PRIMARY KEY (`pay_id`),
  KEY `FK_lib_payment_1` (`mem_id`),
  CONSTRAINT `FK_lib_payment_1` FOREIGN KEY (`mem_id`) REFERENCES `lib_member` (`mem_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/* data for Table lib_payment */

